var CJSA_SERVICE_NAME="ncr.cjsa.Receipt",CJSA_SERVICE_VERSION="1.0.0";export function getReceiptObject(){return Registry.get(CJSA_SERVICE_NAME,CJSA_SERVICE_VERSION)}export function getReceiptServices(){return Registry.get(CJSA_SERVICE_NAME).service}export function getSpecificVersionReceiptObject(e){return Registry.get(CJSA_SERVICE_NAME,e)}export function capabilities(){return getReceiptServices().capabilities}export function status(){return getReceiptServices().status}export function print(e,t,i,r){return getReceiptServices().print(e,t,i,r)}